/* this will take a long time. It should be used only when you need a small subset of dates or when access to uploading a csv isn't possible*/
CREATE OR REPLACE TABLE demo.date 
(
    Date_Key  int64,
    date  Date,
    Day_Number  int64,
    Month_Day_Number  string,
    Day_of_Week_Number  int64,
    Day_of_Week_Name  string,
    Report_Date_Flag  string,
    Previous_Report_Date  date,
    Week_Number  int64,
    Year_Week_Number int64,
    Week_Start_Date  date,
    Week_End_Date  Date,
    Month_Number  int64,
    Year_Month_Number  int64,
    Month_Start_Date  Date,
    Month_End_Date  date,
    First_Report_Date_of_Month  date,
    Last_Report_Day_of_Month  date,
    Quarter_Number  int64,
    Year_Quarter_Number  int64,
    Quarter_State_Date  Date,
    Quarter_End_Date  date,
    Year_Number  int64
)
partition by date
cluster by date
;






















